import React from "react";
import PropTypes from "prop-types";
import style from "./searchStatus.module.css";
const SearchStatus = ({ length }) => {
    const renderPhrase = (number) => {
        if (number === 1) return "person";
        if (number > 1) return "people";
    };
    return (
        <h2 className={style.blockWidth}>
            <span
                className={"badge " + (length > 0 ? "bg-success " : "bg-danger ") + style.blockWidth}
            >
                {length > 0
                    ? `${length + " " + renderPhrase(length)} today here...`
                    : "Nobody here..."}
            </span>
        </h2>
    );
};
SearchStatus.propTypes = {
    length: PropTypes.number
};

export default SearchStatus;
